    DECLARE ReversedText VARCHAR(255) DEFAULT '';
    DECLARE i INT;

    -- Đảo ngược chuỗi
    SET i = CHAR_LENGTH(Text);
    WHILE i > 0 DO
        SET ReversedText = CONCAT(ReversedText, SUBSTRING(Text, i, 1));
        SET i = i - 1;
    END WHILE;

