(83, 'faq', 'Tôi hiểu đây là VPS Trial, cách thức hoạt động của VPS Trial'),
(84, 'faq_noti', '<p><span style=\"color:#000000\"><strong>A. VPS trial l&agrave; g&igrave;?</strong></span></p>\r\n\r\n<p><span style=\"color:#000000\">VPS trial l&agrave; VPS tạo từ c&aacute;c t&agrave;i khoản d&ugrave;ng thử, thời gian live ngắn thường l&agrave; 1 đến 3 th&aacute;ng, c&oacute; thể die giữa chừng (trong khoảng thời gian 1-3 th&aacute;ng), kh&ocirc;ng gia hạn được l&acirc;u d&agrave;i.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Ưu điểm: Gi&aacute; rẻ hơn VPS ch&iacute;nh h&atilde;ng rất nhiều (chỉ bằng 1/2 hoặc 1/3), hiệu suất hoạt động kh&ocirc;ng kh&aacute;c VPS ch&iacute;nh h&atilde;ng.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Nhược điểm: T<span style=\"font-size:1rem\"><span style=\"background-color:#ffffff\">thời gian live ngắn thường l&agrave; 1 đến 3 th&aacute;ng, c&oacute; thể die giữa chừng (trong khoảng thời gian 1-3 th&aacute;ng), kh&ocirc;ng gia hạn được l&acirc;u d&agrave;i.</span></span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><strong>B. Ch&iacute;nh s&aacute;ch bảo h&agrave;nh v&agrave; sử dụng VPS của kh&aacute;ch h&agrave;ng:</strong></span></p>\r\n\r\n<p><span style=\"color:#000000\">1. VPS tại ...&nbsp;sẽ được bảo h&agrave;nh 1 đổi 1 trong suốt qu&aacute; tr&igrave;nh sử dụng, đổi VPS mới nếu die (t&iacute;nh theo số ng&agrave;y c&ograve;n lại chưa sử dụng)!</span></p>\r\n\r\n<p><span style=\"color:#000000\">2. Đ&acirc;y l&agrave; VPS trial n&ecirc;n c&oacute; thể die trong qu&aacute; tr&igrave;nh sử dụng, kh&aacute;ch h&agrave;ng n&ecirc;n sao lưu dữ liệu thường xuy&ecirc;n ph&ograve;ng VPS die tr&aacute;nh mất dữ liệu (lưu &yacute;: khi VPS die, to&agrave;n bộ dữ liệu tr&ecirc;n VPS kh&ocirc;ng thể lấy lại được v&agrave; cũng kh&ocirc;ng b&ecirc;n n&agrave;o c&oacute; thể truy cập được, ...&nbsp;chỉ c&oacute; tr&aacute;ch nhiệm bảo h&agrave;nh VPS mới, kh&ocirc;ng giải quyết c&aacute;c trường hợp y&ecirc;u cầu lấy dữ liệu tr&ecirc;n VPS cũ, v&igrave; vậy h&atilde;y quản l&yacute; dữ liệu của bạn).</span></p>\r\n\r\n<p><span style=\"color:#000000\">3. Kh&aacute;ch h&agrave;ng tự bảo mật th&ocirc;ng tin VPS v&agrave; dữ liệu của m&igrave;nh, n&ecirc;n đổi mật khẩu khi nhận được VPS,...</span></p>\r\n\r\n<p><span style=\"color:#000000\">4. Nghi&ecirc;m cấm sử dụng VPS cho c&aacute;c mục đ&iacute;ch sau:</span></p>\r\n\r\n<p><span style=\"color:#000000\">❌&nbsp;Đ&agrave;o coin,&nbsp;&nbsp;lạm dụng chạy CPU tr&ecirc;n 80%,&nbsp;scan SSH, ddos web, botnet...</span></p>\r\n\r\n<p><span style=\"color:#000000\">❌&nbsp;Ngắt kết nối Network tr&ecirc;n VPS như sử dụng phần mềm đổi IP, Fake IP tr&ecirc;n VPS (1 số phần mềm được ph&eacute;p sử dụng tr&ecirc;n VPS như HMA, VyprVPN, ProtonVPN, VietPN,... thay đổi DNS tr&ecirc;n VPS), bật firewall tr&ecirc;n VPS,...</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
