INSERT INTO `posts` (`Id`, `Title`, `Description`, `Views`, `AvatarPath`, `Username`, `IsPin`, `TimeCreate`, `TimeUnlock`) VALUES
(1, 'SK 20/11', '<main class=\"section\">\n  <div class=\"container\">\n    <h1 class=\"title has-text-centered\">Mã Quà Tặng</h1>\n    \n    <div class=\"columns is-centered\">\n      <!-- Giao Thừa 2025 -->\n      <div class=\"column is-half\">\n        <div class=\"box\">\n          <h2 class=\"subtitle\">Gift Code Giao Thừa 2025</h2>\n          <p class=\"has-text-justified\">\n            Nhân dịp Giao Thừa 2025, chúng tôi gửi đến bạn mã quà tặng đặc biệt: <strong>ZGT2025Z</strong>. Hãy sử dụng mã quà tặng này để nhận những phần thưởng hấp dẫn và giúp bạn bắt đầu năm mới thật may mắn trong trò chơi. Đừng quên chia sẻ với bạn bè để cùng nhận ưu đãi này nhé!\n          </p>\n          <div class=\"notification is-primary\">\n            <h3 class=\"subtitle\">Tham gia sự kiện Zalo Pay 2025!</h3>\n            <p>\n              Chúng tôi cũng rất vui mừng thông báo về sự kiện Zalo Pay 2025, nơi bạn có thể nhận được nhiều phần thưởng hấp dẫn khi thanh toán qua Zalo Pay. Đừng bỏ lỡ cơ hội này, tham gia ngay bằng cách nhấp vào liên kết dưới đây:\n            </p>\n            <a href=\"https://gopettae.com/redirect/sk_zalo\" target=\"_blank\" class=\"button is-link\">Tham Gia Sự Kiện Zalo Pay</a>\n          </div>\n        </div>\n      </div>\n      \n      <!-- Sinh Nhật Trò Chơi 1 Tuổi -->\n      <div class=\"column is-half\">\n        <div class=\"box\">\n          <h2 class=\"subtitle\">Gift Code Sinh Nhật Trò Chơi 1 Tuổi</h2>\n          <p class=\"has-text-justified\">\n            Chúc mừng sinh nhật trò chơi 1 tuổi! Để đánh dấu cột mốc quan trọng này, chúng tôi gửi đến bạn mã quà tặng: <strong>SN1TUOI</strong>. Sử dụng mã này để nhận những phần quà đặc biệt và cùng chúng tôi ăn mừng thành công của trò chơi trong suốt một năm qua!\n          </p>\n        </div>\n      </div>\n    </div>\n  </div>\n</main>\n', 13, '', 'dev', 0, '2024-11-17 20:13:08', NULL),
(2, 'Phiên bản mùa đông', '<section class=\"section\">\n        <div class=\"container\">\n            <!-- Section Title -->\n            <h3 class=\"section-title\">Phiên bản Mùa Đông của GoPet</h3>\n\n            <!-- Game Description -->\n            <p class=\"content\">\n                Trải nghiệm một mùa đông kỳ diệu trong thế giới GoPet với các tính năng mới và đồ họa được cải tiến, tạo ra một không gian đầy tuyết trắng và không khí lễ hội. Phiên bản mùa đông mang đến nhiều sự kiện thú vị và những vật nuôi đáng yêu trong môi trường tuyết rơi tuyệt đẹp.\n            </p>\n\n            <!-- Game Images -->\n            <div class=\"columns is-centered\">\n                <div class=\"column is-half\">\n                    <figure class=\"image\">\n                        <img src=\"https://i.ibb.co/gdy9nHx/phien-ban-mua-dong-mobile.png\" alt=\"GoPet Mùa Đông 1\">\n                    </figure>\n                </div>\n                <div class=\"column is-half\">\n                    <figure class=\"image\">\n                        <img src=\"https://i.ibb.co/2F42n7R/pb-mua-dong-mobile-2.png\" alt=\"GoPet Mùa Đông 2\">\n                    </figure>\n                </div>\n            </div>\n\n            <!-- Download Links -->\n            <div class=\"content\">\n                <p><strong>Tải game ngay:</strong></p>\n\n                <!-- J2ME Version -->\n                <a href=\"~/Upload/Game/JAR/goPet141.jar\" class=\"button is-primary is-medium download-btn\" download>\n                    Tải phiên bản J2ME (.jar)\n                </a>\n\n                <!-- Android Version -->\n                <a href=\"~/Upload/Game/APK/goPet141.apk\" class=\"button is-danger is-medium download-btn\" download>\n                    Tải phiên bản Android (.apk)\n                </a>\n            </div>\n        </div>\n    </section>\n', 12, '', 'DEV', 0, '2024-11-20 22:01:36', '2025-01-29 19:13:26');
